import React, {FunctionComponent, HTMLAttributes, PropsWithChildren} from 'react'
import {ButtonBase} from '@material-ui/core'
import {useStyles} from "./useStyle"


export const ButtonComponent: FunctionComponent = (props: PropsWithChildren<{ className: HTMLAttributes<any>, children: any }>) => {
    const classes = useStyles();

    return (
        <ButtonBase className={`${classes.root} ${props.className}`} {...props.children}/>
    )
};
